def prob_1():
    sacks = string.split("\n")
    common = []
    for sack in sacks:
        half = len(sack)//2
        top = sack[:half]
        bot = sack[half:]
        for thing in top:
            if thing in bot:
                common.append(thing)
                break
    sum = 0
    for i in common:
        if i.upper() == i:
            sum += ord(i)-38

        else:
            sum += ord(i)-96
    return sum

def prob_2():
    def lisAnd(x, y):
        common = []
        for i in x:
            if i in y:
                common.append(i)
        return common
    sacks = string.split("\n")
    groups = []
    group = 0
    mem = 0
    for sack in sacks:
        if mem == 0: groups.append([])
        groups[group].append(sack)
        mem += 1
        if mem == 3:
            mem = 0
            group += 1
        
    common = []
    for group in groups:
        common.append(lisAnd(group[2], lisAnd(group[0], group[1]))[0])
        
    sum = 0
    for i in common:
        if i.upper() == i:
            sum += ord(i)-38
        else:
            sum += ord(i)-96
    return sum        

print(prob_1())
print(prob_2())